(198, 'gamemonetize-1250', 'surfer-bus', 'Surfer Bus', 'https://img.gamemonetize.com/4oyt28u6jluujageun20s197kgluh2um/512x384.jpg', '0', 2, 0, '0', 'Did you ever think how hard is to drive a bus on sand? Now you can give it a try in Water Surfer Bus where you are driving on a beach and you can surf with your bus on water. Have fun! Features â€¢ Multiple levels â€¢ Multiple bus models', '', 'https://html5.gamemonetize.com/4oyt28u6jluujageun20s197kgluh2um/', 'html5', 960, 600, 1576076683, '1', '0'),
(199, 'gamemonetize-1249', 'christmas-2019-match-3', 'Christmas 2019 Match 3', 'https://img.gamemonetize.com/iuqocoz2kpixxezpnkv4mex01x4t7bhq/512x384.jpg', '0', 5, 0, '0', 'Christmas 2019 Match-3 is a good match-3 games with 16 levels. In each level, you need to clear the dirty cells. Make a column or row of three or more christmas symbols of the same type to make them disappears. You can&#039;t swap the locked symbols. If you match 3 or more symbols with a specific shape you will get special symbol, such as bomb symbol, crump symbol, flash symbol and time symbol. Break all the dirty cells in time to complete the level.', '', 'https://html5.gamemonetize.com/iuqocoz2kpixxezpnkv4mex01x4t7bhq/', 'html5', 800, 600, 1576076683, '1', '0'),
(200, 'gamemonetize-1248', 'fire-truck-jigsaw', 'Fire Truck Jigsaw', 'https://img.gamemonetize.com/uyf9ecn3w8cjrf57onlat04vzfetq0zk/512x384.jpg', '0', 5, 0, '0', 'Try to solve this jigsaw game. Start to play with first image and solve it, than go to the next level and try to finish all levels. Choose in which mode you want to play and enjoy in the game.', '', 'https://html5.gamemonetize.com/uyf9ecn3w8cjrf57onlat04vzfetq0zk/', 'html5', 1280, 720, 1576076683, '1', '0'),
