(208, 'gamemonetize-1240', 'anime-kawaii-school-girls-dress-up', 'Anime Kawaii School Girls Dress Up', 'https://img.gamemonetize.com/aw6kelln7ybxd3kjrwlab8r7s6shh63r/512x384.jpg', '0', 4, 0, '0', 'Modern street Japanese fashion coming to you with this great colourful animated &quot;dress up&quot; game! 6 cute School Girls of different looks are ready to dress a stylish outfit which is a mixture of styles such as kawaii, daily European fashion, fairy tales, futuristic sci-fi and more. Create anime avatar and picture her!', '', 'https://html5.gamemonetize.com/aw6kelln7ybxd3kjrwlab8r7s6shh63r/', 'html5', 500, 750, 1576076683, '1', '0'),
(209, 'gamemonetize-1239', 'stunt-racers-extreme', 'Stunt Racers Extreme', 'https://img.gamemonetize.com/hkg6zwr4l76syf4otpd1li0d6m75u9gc/512x384.jpg', '0', 2, 0, '0', 'Take it to the track in the super car of your choice. Customize your car and race! Do well and earn stars that you can use to unlock other cars!', '', 'https://html5.gamemonetize.com/hkg6zwr4l76syf4otpd1li0d6m75u9gc/', 'html5', 800, 640, 1576076683, '1', '0'),
