(271, 'gamemonetize-1177', 'penguin-deep-sea-fishing', 'Penguin Deep Sea Fishing', 'https://img.gamemonetize.com/ko69ukmjsg88fhut90nyqem6455u3h4o/512x384.jpg', '0', 4, 0, '0', 'Its a nice sunny day and our little friend the Happy Penguin decided to go on a fishing trip for cute sea animals and fishes to put in his little aquarium come and experience the joy', '', 'https://html5.gamemonetize.com/ko69ukmjsg88fhut90nyqem6455u3h4o/', 'html5', 960, 640, 1576076683, '1', '0'),
(272, 'gamemonetize-1176', 'streets-of-anarchy-fists-of-war', 'Streets Of Anarchy: Fists Of War', 'https://img.gamemonetize.com/mlwez2ugdm1olz3rzlpl46hijj30vfdi/512x384.jpg', '0', 4, 0, '0', 'There is too much crime in the streets. It&#039;s your duty as a hero to stop them! Clean up the streets and stop the villains. Good Luck Crime Fighter.', '', 'https://html5.gamemonetize.com/mlwez2ugdm1olz3rzlpl46hijj30vfdi/', 'html5', 800, 600, 1576076683, '1', '0'),
