(275, 'gamemonetize-1173', 'christmas-tom-differences', 'Christmas Tom Differences', 'https://img.gamemonetize.com/j398mnps8wz8b8ix8em7kx2y0gob04fk/512x384.jpg', '0', 5, 0, '0', 'Christmas Tom Differences is an online game that you can play for free. Find all differences between two pictures with our lovley Tom. Your job is to find five differences at each picture to clear the level. No time limit just enjoy playing and come back for more.', '', 'https://html5.gamemonetize.com/j398mnps8wz8b8ix8em7kx2y0gob04fk/', 'html5', 480, 854, 1576076683, '1', '0'),
(276, 'gamemonetize-1172', 'extermination-of-flies', 'Extermination of Flies', 'https://img.gamemonetize.com/pv53xvubcwt5xx9ke1k5cm2jz1a09hsz/512x384.jpg', '0', 3, 0, '0', 'Jimmy feels that his kitchen is being a the playground of flies recently, you can hear them buzzing with the lamp off, but he can&#039;t find them when he turns the light on, that is so annoying, so Jimmy wants a full extermination of his kitchen, kill all the flies! but these evil creatures are so sneaky, please help Jimmy kill them, the amount and lethality of the flies will increase while the challenge goes on. Be careful of the flies&#039; attack, and have fun!', '', 'https://html5.gamemonetize.com/pv53xvubcwt5xx9ke1k5cm2jz1a09hsz/', 'html5', 854, 480, 1576076683, '1', '0'),
(277, 'gamemonetize-1171', 'christmas-blocks-collapse', 'Christmas Blocks Collapse', 'https://img.gamemonetize.com/qjkvzn7a62fx6kqi2vkvlyav9df54e8v/512x384.jpg', '0', 5, 0, '0', 'Collapse christmas blocks by connecting 2 or more similar blocks. Collapse 6 or more blocks to get a bomb. More points are awarded as larger connections are made.', '', 'https://html5.gamemonetize.com/qjkvzn7a62fx6kqi2vkvlyav9df54e8v/', 'html5', 640, 960, 1576076683, '1', '0'),
