(283, 'gamemonetize-1165', 'gold-gun-fury', 'Gold Gun Fury', 'https://img.gamemonetize.com/l2xrtfcxpcuf23qa21jqogvoii40hu82/512x384.jpg', '0', 3, 0, '0', '3D first person shooter game. Your team was ambush during your mission. Being the lone survivor, you must fight your enemies alone. Your troop has found out the position of an enemy secret laboratory. Take your gun and eliminate all the guards of the laboratory.', '', 'https://html5.gamemonetize.com/l2xrtfcxpcuf23qa21jqogvoii40hu82/', 'html5', 800, 680, 1576076683, '1', '0'),
(284, 'gamemonetize-1164', 'heart-box', 'Heart Box', 'https://img.gamemonetize.com/m4qrp2locszmxh6vtcaibgi4phewv6yh/512x384.jpg', '0', 5, 0, '0', 'Take the robot through all the experimental puzzle rooms of Professor Rat to release him from the charger! Use the properties of 20 physical objects for complete all puzzles: test-cube, bowling ball, spring trampoline, dynamite, movable platform, conveyor, fan, pneumatic tube, laser, portal, dynamic saw, switch button and others!', '', 'https://html5.gamemonetize.com/m4qrp2locszmxh6vtcaibgi4phewv6yh/', 'html5', 800, 600, 1576076683, '1', '0'),
(285, 'gamemonetize-1163', 'adventures-of-flig', 'Adventures of Flig', 'https://img.gamemonetize.com/u45zjrq1d00d39ic4p4eq2m6y0zo2i1w/512x384.jpg', '0', 5, 0, '0', '&quot;Adventures of Flig&quot; - opens a new world in hockey games without glow and neon! It&#039;s interesting story which combines three games in one - air hockey, runner and labyrinth. Explore beautiful and mysterious worlds and fight the unique enemies to help save Flig&#039;s beloved from the clutches of the vile Spider! And don&#039;t forget the tiny spider Spidey! Guide him through the dangerous mazes and he&#039;ll play a significant role in the adventure!', '', 'https://html5.gamemonetize.com/u45zjrq1d00d39ic4p4eq2m6y0zo2i1w/', 'html5', 800, 600, 1576076683, '1', '0'),
(286, 'gamemonetize-1162', 'subway-runner', 'Subway Runner', 'https://img.gamemonetize.com/xfqaymtsmmb5di5z2k0sj8okbvhh31g1/512x384.jpg', '0', 4, 0, '0', 'Enter the railway! Run as far as you possibly can, evade obstacles of the railway and finish all the achievements in an everchanging and gradually more difficult level design! Collect coins and use them to upgrade your collectible power up capabilities. Challenge your skills and beat your highscore!', '', 'https://html5.gamemonetize.com/xfqaymtsmmb5di5z2k0sj8okbvhh31g1/', 'html5', 800, 600, 1576076683, '1', '0'),
(287, 'gamemonetize-1161', 'cut-it-fair', 'Cut it Fair', 'https://img.gamemonetize.com/mxl7ch0aseiihwtgceqemfvmpyoaqhud/512x384.jpg', '0', 5, 0, '0', 'Don&#039;t Spill It is a slicing game where you will have to slice the fruits with a knife according to the glasses. Cut precisely to complete levels. Good Luck', '', 'https://html5.gamemonetize.com/mxl7ch0aseiihwtgceqemfvmpyoaqhud/', 'html5', 900, 540, 1576076683, '1', '1'),
(288, 'gamemonetize-1160', 'boat-amp-dash', 'Boat &amp; Dash!', 'https://img.gamemonetize.com/k4k527gzxb11q3uqv9y23yy5lhsrnn68/512x384.jpg', '0', 4, 0, '0', 'Boat &amp; Dash is fun game with one finger control. Control the running boat and smash the boxes, wheels, drums placed on the way. Avoid striking the rocks else you end your life. It simple game to play but hard to clear the higher levels.', '', 'https://html5.gamemonetize.com/k4k527gzxb11q3uqv9y23yy5lhsrnn68/', 'html5', 500, 750, 1576076683, '1', '0'),
(289, 'gamemonetize-1159', 'zombiecraft-2', 'ZombieCraft 2', 'https://img.gamemonetize.com/iobi9v9jlrt01fmizjbm1rtsi1x2akat/512x384.jpg', '0', 4, 0, '0', 'ZombieCraft is a adventure rpg game. Select your favourite character, gear up axe, swords or any item and kill the zombies. Show your friends how many you kill zombies ? if you kill 50 zombies you will go next level.', '', 'https://html5.gamemonetize.com/iobi9v9jlrt01fmizjbm1rtsi1x2akat/', 'html5', 960, 600, 1576076683, '1', '0'),
(290, 'gamemonetize-1158', 'roll-this-ball', 'Roll This Ball', 'https://img.gamemonetize.com/ga60e46mqmsgc2a4n8ec42u9aqnshs0y/512x384.jpg', '0', 5, 0, '0', 'Do you like classic sliding and unblocking puzzles? Then this game is just for you! Move the wooden tiles to unblock the path and make a way for the steel ball to reach the red, shiny goal. Enjoy the fun with this wildly popular brain-teasing game and test your wits!', '', 'https://html5.gamemonetize.com/ga60e46mqmsgc2a4n8ec42u9aqnshs0y/', 'html5', 600, 800, 1576076683, '1', '0'),
(291, 'gamemonetize-1157', 'jewel-pets-match', 'Jewel Pets Match', 'https://img.gamemonetize.com/20ntpuqciwjuzsijq6zmke0pz8v037w5/512x384.jpg', '0', 5, 0, '0', 'Get your mood up with happy pets! Match them in greater numbers to erase a bigger portion of the board! It can help you crush through blocks standing in your way. Classic turn based match-3 arcade with lots of challenging levels awaits you!', '', 'https://html5.gamemonetize.com/20ntpuqciwjuzsijq6zmke0pz8v037w5/', 'html5', 800, 600, 1576076683, '1', '0'),
(292, 'gamemonetize-1156', 'mahjong-mania', 'Mahjong Mania!', 'https://img.gamemonetize.com/0ea8nd6q0sakjc8fh9q036yf22xch4xi/512x384.jpg', '0', 5, 0, '0', 'The ancient Chinese game in your pocket. Clear the boards full of beautiful tiles, piled in thoughtful pyramids. Hone your skills, strategy and calculations to win all available cups in all game modes. Can you hadle it? It&#039;s time for Mahjong Mania!', '', 'https://html5.gamemonetize.com/0ea8nd6q0sakjc8fh9q036yf22xch4xi/', 'html5', 600, 600, 1576076683, '1', '0'),
(293, 'gamemonetize-1155', 'police-cars-parking', 'Police Cars Parking', 'https://img.gamemonetize.com/xd0b8w4wiikrpsakz76ym4cknjbzyf3w/512x384.jpg', '0', 2, 0, '0', 'It starts off nice and easy where you just need to avoid barriers and cones. As you advance the levels become bigger and the spots further away and more difficult to get to. So race around, avoiding cars and jam packed streets of cars, ambulances and obstacles. This parking simulation is a real challenge where you will really need your best driving skills to complete the missions.', '', 'https://html5.gamemonetize.com/xd0b8w4wiikrpsakz76ym4cknjbzyf3w/', 'html5', 900, 600, 1576076683, '1', '0'),
