(295, 'gamemonetize-1153', 'murder-the-homicidal-liu-into-damnation', 'Murder The Homicidal Liu - Into Damnation', 'https://img.gamemonetize.com/ljclklz8lf0h21wmbrct8xrdnjxhtegf/512x384.jpg', '0', 3, 0, '0', 'You are about to kill Jeff The Killer. Finally he is dead. You&#039;re going home to eat and rest. Those are your plans but someone has other plans for you... Enter the Liu Dimension where all the monsters are. Find some clues and try to stop him. It won&#039;t be easy! Features: - Four Weapons: Knife, Dual Pistols, Shotgun, SMG - 18 levels to complete - Good story - Good graphics - Intuitive controls that are easy to pick up and play - Gameplay from Poison Games that you love.', '', 'https://html5.gamemonetize.com/ljclklz8lf0h21wmbrct8xrdnjxhtegf/', 'html5', 800, 650, 1576076683, '1', '0'),
