(299, 'gamemonetize-1149', 'mafia-car-3d-time-record-challenge', 'Mafia Car 3D - Time Record Challenge', 'https://img.gamemonetize.com/v187f8sdvbo3lbfdwg9frzvxov3xi70d/512x384.jpg', '0', 2, 0, '0', 'Are you in for a little challenge? If yes, then let&#039;s see if you can be the quickest in town with your mafia car. In this game you have to drive through the city as fast as you can. Reach to the end point and see what time you got. Hold tight on the steering wheel and good luck!', '', 'https://html5.gamemonetize.com/v187f8sdvbo3lbfdwg9frzvxov3xi70d/', 'html5', 800, 600, 1576076683, '1', '0'),
