(305, 'gamemonetize-1143', 'halloween-matching', 'Halloween Matching', 'https://img.gamemonetize.com/h1yl1pq2knavkroajfi7fixpti1arfr9/512x384.jpg', '0', 5, 0, '0', 'Match 3 or more identical halloween avatars to make them explode before time runs out. If you match 4 or more identical halloween avatars you&#039;ll get extra time. Match 4 identical avatars in a row / column to get a bomb. Match 5 identical avatars in a row / column to get a changing avatar, that will destroy all identical avatars and will give you extra time for each exploded avatars. If you are lucky, you&#039;ll get extra time in the board.', '', 'https://html5.gamemonetize.com/h1yl1pq2knavkroajfi7fixpti1arfr9/', 'html5', 540, 960, 1576076683, '1', '0'),
(306, 'gamemonetize-1142', 'bear-chase', 'Bear Chase', 'https://img.gamemonetize.com/x70qdl7hih5fl5gm93m9t3wdkffkrgjp/512x384.jpg', '0', 5, 0, '0', 'In this platform game your job is to collect presents jumping around platforms and to earn points. But suddenly from your shadow will came more bears who will follow you and you need to avoid them, The black bears will chase you.', '', 'https://html5.gamemonetize.com/x70qdl7hih5fl5gm93m9t3wdkffkrgjp/', 'html5', 1280, 720, 1576076683, '1', '0'),
