(752, 'gamemonetize-696', 'jungle-survival-jurassic-park', 'Jungle Survival Jurassic Park', 'https://img.gamemonetize.com/8b2luv7a438q1snuogk7jllcbvifq8ty/512x384.jpg', '0', 7, 0, '0', 'Join in the great awesome multiplayer and campaign Jurassic park jungle. Here you will fight with different models of dinosaurs from milion years ago but is back in the present so survive with your friends in multiplayer or try our offline campaign and enjoy running and shooting there. Have Fun.', '', 'https://html5.gamemonetize.com/8b2luv7a438q1snuogk7jllcbvifq8ty/', 'html5', 800, 600, 1576076683, '1', '0'),
