(754, 'gamemonetize-694', 'xtreme-speed-stunts-bmx-gm', 'Xtreme Speed Stunts BMX GM', 'https://img.gamemonetize.com/3ekpcr4j5zrziz04oj2qq3xnkmvzi4vl/512x384.jpg', '0', 2, 0, '0', 'Are you ready for Xtreme Speed Stunts BMX GM? Well... you can play this game and see if you are good with your virtual BMX. You are a BMX RIDER and you can do tricks on your Moto motor bike, race your way around all the tracks in this fun game madalin super romania stunt 2 game the stick man loves motorsport so hes biking over dirt and tar on his motor cycle, so start racing with lots of action and cycle your way to Bike Heaven. The narrow tracks for bicycle riding are building upon hills and mountains. To master bicycle tricks on the zigzag roads you need to ride slow with accuracy. Have Fun!', '', 'https://html5.gamemonetize.com/3ekpcr4j5zrziz04oj2qq3xnkmvzi4vl/', 'html5', 800, 600, 1576076683, '1', '0'),
