(768, 'gamemonetize-680', 'scary-halloween-differences', 'Scary Halloween Differences', 'https://img.gamemonetize.com/pu4iqr9dr3odn480d0k2zld7mwrqrm5h/512x384.jpg', '0', 5, 3, '0', 'Scary Halloween Differences is interesting kids game and it&#039;s time for you to have fun!In this game you need to find the differences in these funny kids images. Behind these pictures are small differences. Can you find them? They are fun designs for you to play with. A game that is fun and educational because it will help you improve your observation and concentration skills. You have 10 levels and 7 differences, for each level you have one minute to finish the same. Have fun!', '', 'https://html5.gamemonetize.com/pu4iqr9dr3odn480d0k2zld7mwrqrm5h/', 'html5', 960, 540, 1576076683, '1', '0'),
