(773, 'gamemonetize-675', 'east-princess-through-the-ages', 'East Princess - Through the Ages', 'https://img.gamemonetize.com/r1v84ii7xf4b2wf7qex78128otgmokcf/512x384.jpg', '0', 1, 0, '0', 'Salam-alaikum, dear friend. Welcome to the palace of the mysterious Princess of the East. Here you are waiting for extraordinary miracles. Rather, sit down on a soft carpet and listen to fairy tales worthy of the padishah himself. Admire the gorgeous princess outfits, contemplate how precious stones sparkle in her hair. Truly, the beauty of the princess can not be described in words. Help the most worthy of the Princesses of the East to get ready to receive guests. Choose a silk dress or an open top with puffy pants. Cover the thick black hair of a princess in a braid or lay it in a ponytail. ', '', 'https://html5.gamemonetize.com/r1v84ii7xf4b2wf7qex78128otgmokcf/', 'html5', 800, 600, 1576076683, '1', '0'),
