(952, 'gamemonetize-496', 'slenderman-must-die-dead-space', 'Slenderman Must Die: Dead Space', 'https://img.gamemonetize.com/d5j9cccxgjbqw693mmko4lyiokth4hqh/512x384.jpg', '0', 3, 0, '0', 'Slenderman Must Die: Dead Space is another awesome title from the Slenderman Must Die series. The legend of Slenderman continues and it seems that his terrors and evil will never end! In this episode, you must try and hunt down or escape from Slenderman in an abandoned space station. You must collect different energy cells scattered around the station in order to survive and escape. Look out for the creep villain and use any hi-tech weapon you can find to destroy him!', '', 'https://html5.gamemonetize.com/d5j9cccxgjbqw693mmko4lyiokth4hqh/', 'html5', 1100, 700, 1576076683, '1', '0'),
