(1222, 'gamemonetize-226', 'real-gangster-city-crime-vegas-3d-2018', 'Real Gangster City Crime Vegas 3D 2018', 'https://img.gamemonetize.com/qy6y3b82lhc4gn6u2kpvywh157qb6t3w/512x384.jpg', '0', 1, 0, '0', 'Welcome to Real Gangster City Crime Vegas 3D 2018, Explore the city of vegas of gangster crime, Become the most notable gangsters in vegas city crime of US Streets by using guns, cars, bikes, planes, trucks, buses. As a real gangster in this finest of vegas crime games play as a crime lord to deal with vegas gangsters to be one of the best crime gangster. Instructions: WASD - move. LKM - atack. Shift - run. Space - jump. F - use car', '', 'https://html5.gamemonetize.com/qy6y3b82lhc4gn6u2kpvywh157qb6t3w/', 'html5', 960, 600, 1576076683, '1', '0'),
